import Layout from './layout';

export default function Payment({ Elements, CheckoutForm, promise }) {
    return (
      <div>
        <Layout>
          <Elements stripe={promise}>
            <CheckoutForm />
          </Elements>
        </Layout>
      </div>
    );
  }
